function Home() {
  return (
      <div className="card bg-dark text-white">

          <img src={"https://uploads-ssl.webflow.com/5cd1e68968db65ba07de7bfb/5fee46ab47d282950f001ff1_Jupe%20Lit%20Exterior%20(photo%20credit_%20Sam%20Gezari).jpg"}
          class="card-img"
          alt="..."/>
          <div class="card-img-overlay">
    <h5 class="card-title">Tiny Home</h5>
    <p class="card-text">
      This is a wider card with supporting text below as a natural lead-in to additional
      content. This content is a little bit longer.
    </p>
    <p class="card-text"></p>
     </div>
      </div>
  );
}

export default Home;
